  namespace: BelNytheraSeiche.TrieDictionary
  summary: A concrete implementation of <xref href="BelNytheraSeiche.TrieDictionary.KeyRecordDictionary" data-throw-if-not-resolved="false"></xref> that uses a Directed Acyclic Word Graph (DAWG).
  remarks: >-
    This class stores keys in a DAWG, which is a data structure that compresses a standard Trie

    by merging common prefixes and suffixes to reduce redundancy.

    <p>

    <strong>Important Usage Notes:</strong>

    <ul><li><strong>Read-Only Structure:</strong> The dictionary is built once from a collection of keys and is effectively read-only afterward. The <code>Add</code> and <code>Remove</code> operations for keys are not supported and will throw a <xref href="System.NotSupportedException" data-throw-if-not-resolved="false"></xref>.</li></ul>

    </p>
